// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;
import "./Helpers.sol";

contract Library is Helpers{
    address public owner;

    struct Book {
        uint id;
        string name;
        uint quantity;
        bool exists;
    }

    uint counter;

    mapping(uint => Book) BookList;

    mapping(uint => address[]) BookBorrowerHistory;

    mapping(address => uint[]) ClientBorrowList;

    modifier onlyOwnable(){
        require(msg.sender == owner, "Current user is not owner!");
        _;
    }

    modifier bookExists(uint bookId){
        require(BookList[bookId].exists,"Book does not exist in library!");
        _;
    }

    constructor(){
        owner = msg.sender;
    }

    function AddBook(Book calldata book) public onlyOwnable{
       if(BookList[counter].exists){
            revert("Book already exists in the Library!");
        }

        BookList[counter].id = counter;
        BookList[counter].name = book.name;
        BookList[counter].quantity = book.quantity;
        BookList[counter].exists = true;
        counter++;
    }

    function BorrowBook(uint bookId) public bookExists(bookId){    
        if(BookList[bookId].quantity==0){
            revert("This book is out of stock currently!");
        }    
        if(intArrContainsValue(bookId, ClientBorrowList[msg.sender])){
            revert("You've already borrowed that book!");
        }

        ClientBorrowList[msg.sender].push(bookId);


        if(!addressArrContainsValue(msg.sender, BookBorrowerHistory[bookId])){
            BookBorrowerHistory[bookId].push(msg.sender);        
        }

        BookList[bookId].quantity --;
    }

    function ReturnBook(uint bookId) public bookExists(bookId){
        if(!intArrContainsValue(bookId, ClientBorrowList[msg.sender])){
            revert("You havent borrowed that book!");
        }

        //remove book from list of borrowed books for the specific client
        removeIntArrElement(ClientBorrowList[msg.sender], bookId);
        BookList[bookId].quantity ++;
    }
}

